// Profile.js
import React, { useState, useEffect } from 'react';
import './Profile.css'; // Import the CSS file

const Profile = () => {
    const [user, setUser] = useState(null);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const token = localStorage.getItem('token');
                const response = await fetch('http://localhost:3001/profile', {
                    headers: {
                        'Authorization': `Bearer ${token}`
                    }
                });
                if (response.ok) {
                    const userData = await response.json();
                    setUser(userData);
                } else {
                    setError('Failed to fetch user data');
                }
            } catch (error) {
                console.error(error);
                setError('Failed to fetch user data');
            }
        };

        fetchUserData();
    }, []);

    return (
        <div className="profile-card">
            <h1 className="profile-heading">User Account Information:</h1>
            {error ? (
                <p className="error-message">{error}</p>
            ) : user ? (
                <div>
                    <div className="profile-info">
                        <strong>Name:</strong> <span>{user.name}</span>
                    </div>
                    <div className="profile-info">
                        <strong>Email:</strong> <span>{user.email}</span>
                    </div>
                    <div className="profile-info">
                        <strong>Phone Number:</strong> <span>{user.phoneNo}</span>
                    </div>
                    <div className="profile-info">
                        <strong>Address:</strong> <span>{user.address}</span>
                    </div>
                    <div className="profile-info">
                        <strong>Area:</strong> <span>{user.area}</span>
                    </div>
                    <div className="profile-info">
                        <strong>City:</strong> <span>{user.city}</span>
                    </div>
                    <div className="profile-info">
                        <strong>Description:</strong> <span>{user.description}</span>
                    </div>
                </div>
            ) : (
                <p className="error-message">User information not found.</p>
            )}
        </div>
    );
};

export default Profile;
